import React, { useEffect, useState, memo } from "react"
import { motion } from "framer-motion"

import {numbers} from '../../utils/numbers';

const findPrevNumber = ( number, step = 3 ) => {
  const length = numbers.length;
  const index = numbers.findIndex(n => n.number === number);
  const remainIndex = step - index;
  const prevIndex = remainIndex > 0 ? length - remainIndex : index - step;

  return numbers.find((n, index) => index === prevIndex);
}

const findNextNumber = ( number, step = 3 ) => {
  const length = numbers.length;
  const index = numbers.findIndex(n => n.number === number);
  const estimateIndex = index + step > length - 1 ? (index + step - length) : index + step;

  return numbers.find((n, index) => index === estimateIndex);
}

